import moment from "moment";

export class InfoBpmModel{    
    constructor(instanceId=0,) {
      this.instanceId=0;
      this.transactId=0;
      this.processId=0;
      this.activityId=0;
      this.personId=0;
      this.personName="";
    }
  }
